import ReactDOM from 'react-dom';

function Ineuron()
{
  return (
    <div>
      <h1>iNeuron Bengaluru</h1>
      <Blockchain/>
      <Blockchain/>
      <React/>
    </div>

  );

}

const Blockchain = () =>
{
  return <h4>Blockchain + React is Deadly </h4>
} 

const ReactJS = () =>
{
  return <h4>Learning React can get us more pay. FOCUS is key </h4>
} 


